import React from 'react';
import './home.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <section id="home">
        <h2>Welcome to  Name</h2>
        <p>Your trusted healthcare provider.</p>
      </section>
      <section id="doctors">
        <h2>Our Doctors</h2>
        <div className="doctor-list">
          {/* Placeholder for doctor cards */}
          <DoctorCard name="Dr. John Doe" specialty="Cardiology" />
          <DoctorCard name="Dr. Jane Smith" specialty="Pediatrics" />
        </div>
      </section>
      <section id="contacts">
        <h2>Contact Us</h2>
        <p>For appointments and inquiries:</p>
        <p>Phone: 123-456-7890</p>
        <p>Email: info@hospital.com</p>
      </section>
      <section id="about">
        <h2>About Us</h2>
        <p>We are committed to providing high-quality healthcare...</p>
      </section>
      <footer>
        <p>&copy; 2024 Hospital Name. All rights reserved.</p>
      </footer>
    </div>
  );
}

function Navbar() {
  return (
    <nav>
      <ul>
        <li><a href="#home">Home</a></li>
        <li><a href="#doctors">Doctors</a></li>
        <li><a href="#contacts">Contacts</a></li>
        <li><a href="#about">About</a></li>
      </ul>
    </nav>
  );
}

function DoctorCard({ name, specialty }) {
  return (
    <div className="doctor-card">
      <h3>{name}</h3>
      <p>{specialty}</p>
    </div>
  );
}

export default App;
